import { hover } from "@testing-library/user-event/dist/hover";
import React from "react";
import styled from "styled-components";
import IPhone from "./iPhone/iPhone";

const Main = () => {

    return (
        <MainContainer>
            <MainLeftSide>
                <LeftSideSwap>
                    <FirstString>Цифровое решение для вашего бизнеса</FirstString>
                    <SecondString>Полный цикл разработки</SecondString>
                    <ThirdString>Уникальные решения</ThirdString>
                </LeftSideSwap>

                <OurProjects style={{ animationDelay: `calc(var(--scroll) * -1s)` }}>Наши проекты</OurProjects>
            </MainLeftSide>
            <MainRightSide>
                <IPhone bgcolor={'white'} />
            </MainRightSide>
        </MainContainer>
    )
}

const MainContainer = styled.div`
    width: 70%;
    min-height: 80vh;
    margin: 90px auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const MainLeftSide = styled.div`
    width: 45%;

`

const LeftSideSwap = styled.div`
    position: fixed;
    width: 40%;
    animation: positionTop 0.3s linear 3s 1 normal both;
`

const FirstString = styled.h1`
    color: black;
    animation: mainPageFirst 0.2s ease-in 1s 1 normal both;
`

const SecondString = styled.h1`
    animation: mainPageSecond 1.2s ease-in 1.2s 1 normal both;
`

const ThirdString = styled.h1`
    animation: mainPageSecond 1.2s ease-in 2.4s 1 normal both;
`

const OurProjects = styled.h1`
    position: fixed;
    animation: positionBottom 0.3s linear 3.3s 1 direction fill-mode;
`

const MainRightSide = styled.div`
    position: fixed;
    top: 90px;
    right: 15%;
`

export default Main
